column8:
缶のカタカタ音の消音、内装の傷付き防止にも！<br><br>

【ネコポス限定！送料無料】<br>マルチカラー フレグランスシリコンカバー（缶タイプ用）<br>１０色から選べる！香りのためのお洋服♪<br>芳香剤 カバー ケース 置き型<br>【AWESOME/オーサム】<br><br>

収納サイズ：直径67～69mm×高さ29～31mm<br><br><br>

大人気のマルチカラーシリーズより、フレグランスシリコンカバー（缶タイプ用）が新登場♪<br> <br>
缶詰タイプの芳香剤に合わせて作った、外側をきれいに包み込めるシリコンラバー製のカバーがこちらです。<br><br>
単純に缶の外側を包むという構造なだけでなく、上側の樹脂製のフタとのマッチングを考慮して、かみ合わせる部分を一回り細くなる形状に仕上げたことで、ピッタリとフィットするようにしています。<br><br>
見た目の変化はもちろん、缶全体をグリップ力のあるシリコンラバーで包むようになるので、走行中に滑って動いてしまうのを軽減する働きもあります。<br><br>
ラインアップは、車内色に合わせやすいブラックや、最もオーソドックスな見た目に仕上がるホワイトの他、ボディーカラーや小物の差し色、香りの種類などに合わせられるよう、全10色をご用意しています。<br><br>
背面に『AWESOME（オーサム）』のブランドロゴが入っています。<br><br>
【カラー】<br>
ブラック・ブラウン・レッド・ピンク・オレンジ・イエロー・グリーン・ブルー・ホワイト・クリアグリーン（蓄光）<br><br>
缶タイプ芳香剤にピッタリと収まる設計です。<br>
裏面には、AWESOMEのロゴが入っています。<br>
カバーをつけることによって見栄え良く♪<br>
並べて置いてもカワイイ！<br><br>


<br>
※こちらのページはパッケージ無しで、ネコポス発送限定となります。<br>
代引きは不可。<br><br>



■車種<br>
・トヨタ：アイシス/アクア/アバロン/アベンシスセダン/アベンシスワゴン/アリオン/アリスト/アルファード/アルファードハイブリッド/イスト/イプサム/ウィッシュ/エスティマ/エスティマハイブリッド/オーリス/ヴァンガード/ヴィッツ/ヴェルファイア/ヴェルファイアハイブリッド/ヴォクシー/カムリ/カリーナ/カローラ/クラウン/シエンタ/スペイド/セルシオ/ソアラ/ノア/ハイエース/ハリアー/パッソ/ビスタ/ファンカーゴ/ブリザード/プリウス/プリウスα/ポルテ/マークＸ/ラクティス/ランドクルーザー/ランドクルーザープラド/レジアス/86/ＦＪクルーザー/ＲＡＶ４/ＳＡＩ/ｂＢ/ｉＱ/ハイエース4型/60ハリアー/80ノア・ヴォクシー
など<BR>
<BR>
・ダイハツ：アトレー/アルティス/エッセ/オプティ/クー/コペン/コンパーノ/シャレード/ストーリア/ソニカ/タント/テリオス/デルタ/ネイキッド/ハイゼット/パイザー/ビーゴ/フェローＭＡＸ/ブーン/ミラ/ムーヴ/メビウス/ラガー/リーザ/ロッキー/ＭＡＸ/ＹＲＶ
など<BR>
<BR>
・ホンダ：アクティトラック/アクティバン/アコード/インサイト/インスパイア/エアウェイブ/エリシオン/エレメント/オデッセイ/オルティア/ヴェゼル/キャパ/クロスロード/ザッツ/シビック/ステップワゴン/ストリーム/ゼスト/バモス/フィット/フリード/モビリオ/ライフ/レジェンド/ＣＲ－Ｖ/ＣＲ－Ｚ/ＭＤＸ/ＮＢＯＸ/ＮIII３６０/Ｎ－ＯＮＥ/Ｎ－ＷＧＮ/Ｎ３６０/Ｚ
など<BR>
<BR>
・日産 （ニッサン）：ウイングロード/エクストレイル/エルグランド/オッティ/キックス/キャラバン/キューブ/シーマ/ジューク/スカイライン/ステージア/セドリック/セフィーロ/セレナ/ティーダ/ティアナ/デイズ/デイズルークス/デュアリス/ノート/バネット/フーガ/フェアレディＺ/ブルーバードバン/プレサージュ/プレセア/マーチ/マイクラＣ＋Ｃ/ムラーノ/モコ/ラシーン/ラティオ/ラフェスタ/リーフ/リバティ/ルークス/ルネッサ/ＧＴ－Ｒ/クリッパー/バネット/キャラバン
など<BR>
<BR>
・スズキ：アルト/エスクード/エブリイ/エリオ/カプチーノ/カルタス/キザシ/キャラ/キャリ/ジムニー/スイフト/スプラッシュ/スペーシア/セルボ/ソリオ/ツイン/ハスラー/パレット/フロンテ/マイティボーイ/ランディ/ワゴンＲ/Ｋｅｉ/ＭＲワゴン/ＳＸ４/Ｘ－９０
など<BR>
<BR>
・三菱 （ミツビシ）<FONT size="+1">：</FONT>
アイ/アウトランダー/エアトレック/ジープ/ディオン/ディンゴ/デリカ/パジェロ/ミニカ/ランサー/ＲＶＲ/ｅＫ など<BR><BR>
・スバル<FONT size="+1">：</FONT>
アウトバック/インプレッサ/エクシーガ/サンバー/ステラ/トラヴィック/トレジア/ドミンゴ/フォレスター/プレオ/プレオ・ネスタ/プレオカスタム/プレオプラス/ルクラ/ルクラカスタム/レガシィ/レックス/レヴォーグ/360/ＢＲＺ/Ｒ１/Ｒ２
など<BR><BR>
・マツダ：アクセラ/アテンザ/スピアーノ/デミオ/トリビュート/ビアンテ/フレア/プレマシー/プロシード/ベリーサ/ミレーニア/ラピュタ/ランティス/ＡＺ/ＣＸ－５/ＣＸ－７/ＭＰＶ
など<BR>
・レクサス：CT/GS/HS/IS/ISF/LFA/LS/RX/SC など<BR><BR><br>







